import React from 'react';
import {Pie, PieChart} from 'recharts';
import config from './config/defaultblueprint.json';



const bp = config.chartInfo.AnglePieData
const AnglePie = ()=> {
    return (
      <PieChart width={600} height={500}>
        <Pie dataKey="value" startAngle={180} endAngle={0} data={bp} cx={170} cy={140} outerRadius={80} fill="#8884d8" label />
      </PieChart>
    );
  }

export default AnglePie;
